import React, {useState} from 'react';
import './App.css';
import TicTacToe from './components/TicTacToe/TicTacToe';
import { useDispatch } from 'react-redux';
import { useTypedSelector } from './store/Reducers';
import { removeVisibleAction, TypeTicTacToe } from './store/Reducers/Reducer';

function App() {

  const [crossOrCircle, setCrossOrCircle] = useState<boolean>(false)

  const dispatch = useDispatch()
  const { TicTacToe } = useTypedSelector(state => state.ticTacToe)


  const visibleIcon = (t: TypeTicTacToe, crossOrCircle: boolean) => {
    dispatch(removeVisibleAction(t))
    dispatch(removeIconAction(t, crossOrCircle))
    setCrossOrCircle(!crossOrCircle)
  }

  return (
    <div className="App">
      <TicTacToe crossOrCircle={crossOrCircle} setCrossOrCircle={setCrossOrCircle}/>
    </div>
  );
}

export default App;
